import React,{Component} from "react";
import "./footer.css"


class Footer extends Component {

    constructor(props) {
        super(props);
        this.state = {
            footer: "footer-flex-container"
        };
    }

    onClickFooter = () => {
        this.setState({
            footer: "footer-flex-container-onClick"
        })
    }

    render(){
        return(
            <div className="footer-flex-container">
                <div className="footer-conteudo">
                    <div className="footer-redes-sociais">
                        <labe> Redes Sociais </labe>
                    </div>
                    <div className="footer-localizacao">
                            <label>Localização </label> 
                    </div>
                    <div className="footer-flickr">
                            <label> Galeria de fotos Flickr</label>
                    </div>
                </div>
                <div className="footer-direitos">
                    <lable> Direitos Reservados</lable>
                </div>
            </div>
        )
    }


}
export default Footer;
